import './App.css';
import { BrowserRouter, Route, Switch, Link } from 'react-router-dom';
import Login from './components/Login';

function App() {
  return <BrowserRouter>
      <Switch>
    <Route path="/login">
      <Login />
    </Route>
    <Route path="/page2">
      <h1>Page 2</h1>
    </Route>
    <Route path="/">
      <h1>Accueil</h1>
    </Route>
  </Switch>
  </BrowserRouter>
}

export default App;
